import React from 'react';
import { View, Image } from 'react-native';
import Carousel from 'react-native-snap-carousel';

const ImageCarousel = ({ images }) => {
  return (
    <View>
      <Carousel
        data={images}
        renderItem={({ item }) => (
          <Image
            source={{ uri: item }}
            style={{ width: 400, height: 200 }}
          />
        )}
        sliderWidth={300}
        itemWidth={200}
      />
    </View>
  );
};

export default ImageCarousel;
